import styles from "../styles/About.module.css";

import { Box } from "@mui/material";

const About = () => {
  return (
    <div className={styles.all}>
      <Box color="white" bgcolor="palevioletred" p={1}>
        Hi, I'm Sana Merchant!
      </Box>
    </div>
  );
};

export { About };
